class Tile{
  constructor(number){
    this.number = number;
    this.up = true;
    this.x = canvas.width*((number+0.5)/num_tiles);
    this.y = canvas.height/2;
    this.width = canvas.width/num_tiles;
    this.height = canvas.height*3/4;
    this.fill = 'white';
  }

  onclick(){
    if (this.up){
      this.up = false;
      this.height /= 2;
      this.fill = 'gray';
    } else {
      this.up = true;
      this.height *= 2;
      this.fill = 'white';
    }
  }

  inrect(){
    return ((this.x - this.width/2 < mouseX)
        && (mouseX < this.x + this.width/2)
        && (this.y - this.height/2 < mouseY)
        && (mouseY < this.y + this.height/2));
  }

  draw(){
    fill(this.fill);
    rect(this.x, this.y, this.width, this.height);
    fill('black');
    text(this.numeric(), this.x, this.y)
  }

  numeric(){
    return this.number+1;
  }

}

function drawTiles(){
  for (const tile of tiles){
    tile.draw();
  }
}

function clickTiles(){
  for (const tile of tiles){
    if (tile.inrect()){
      tile.onclick();
    }
  }
}

function setup(){
  pixelDensity(1);
  const cnv_width = document.getElementById('sketch-div').clientWidth;
  const cnv = createCanvas(cnv_width, cnv_width/4);
  rectMode(CENTER);
  textAlign(CENTER, CENTER);
  textSize(20);

  cnv.parent("sketch-div")

  num_tiles = 10;
  tiles = []
  for (let i=0; i<num_tiles; i++){
    tiles[i] = new Tile(i);
  }
}

function draw(){
  background('#EEEEEE');
  drawTiles();
}

function mouseClicked(){
  clickTiles();
}

function getup(){
  let up = [];
  for (const tile of tiles){
    if (tile.up){
      up.push(tile.numeric());
    }
  }
  return up.toString().split(",").join(", ")
}

function submit(){
  const roll = document.getElementById("roll").value.toString();
  const result = document.getElementById("result");
  if (roll){
    const config = getup();
    const best_move = lookup_table[config][roll];
    if (best_move == "None"){
      result.innerHTML = "No moves left!";
    } else if (best_move == undefined){
      result.innerHTML = "Enter a valid roll!";
    } else {
      result.innerHTML = best_move;
    }
  } else {
    result.innerHTML = "Type in a roll!";
  }
}
